#!/bin/bash
 userdel lxd
 userdel systemd-coredump
 clear
 echo -e " \E[44;1;37mUSUARIOS    LIMITE     CONTRASEÑAS   EXPIRADOS\033[0m"
 #USUARIOS
 for users in `awk -F : '$3 > 900 { print $1 }' /etc/passwd |sort |grep -v "nobody" |grep -vi polkitd |grep -vi system-`
 do
 #USUARIOS
 touch usuarios.db
 #LIMITE
 if [[ $(grep -cw $users $HOME/usuarios.db) == "1" ]]; then
 limite=$(grep -w $users $HOME/usuarios.db | cut -d' ' -f2)
 else
 limite="1"
 fi
 #LIMITE
 
 
 #CONTRASEÑA
 if [[ -e "/etc/SSHPlus/amor/$users" ]]; then
 amor=$(cat /etc/SSHPlus/amor/$users) >> usuarios.db
 else
 amor="Null"
 fi
 #CONTRASEÑA
 
 datauser=$(chage -l $users |grep -i co |awk -F : '{print $2}')
 if [ $datauser = never ] 2> /dev/null
 then
 data="\033[1;33mNunca\033[0m"
 else
 databr="$(date -d "$datauser" +"%Y%m%d")"
 hoje="$(date -d today +"%Y%m%d")"
 if [ $hoje -ge $databr ]
 then
 data="\033[1;31mVence\033[0m"
 else
 dat="$(date -d"$datauser" '+%Y-%m-%d')"
 data=$(echo -e "$((($(date -ud $dat +%s)-$(date -ud $(date +%Y-%m-%d) +%s))/86400)) \033[1;37mDias\033[0m")
 fi
 fi
 
 
 
 
 Usuario=$(printf ' %-10s' "$users")
 limites=$(printf ' %-7s' "$limite")
 contrasena=$(printf ' %-5s' "$amor")
 Data=$(printf ' %-3s' "data")
 echo -e " \033[1;37m$Usuario   $limites    $contrasena       $data\033[0m"
 echo -e " \033[1;35m━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━\033[0m"
 done
 touch /etc/SSHPlus/Exp
 expirado=$(cat /etc/SSHPlus/Exp)
 echo -e "\E[44;1;37mA SIDO LISTADA ESCRIVE 2 PARA AUTOVOLVER AL LISTADO\033[0m  " "\033[1;33m\033[2;33m\E[41;1;37m[15]-MENU PRINCIPAL\033[0m"
 echo -e "\E[44;1;37m ESCRIVE 0 PARA SALIR DE TODO EL MENU\033[0m"
 echo ""
 while [ "$opcion" != "0" ]
 do
 echo -ne "\E[41;1;37mOPCION:\033[0m""\033[1;37m>>\033[0m "; read opcion
 case $opcion in
 
 2)/root/listausuarios.sh
 ;;
 15)/root/menu
 ;;
 esac
 exit
 done ./listausuarios.sh
